import { Collapse } from 'antd';
import React from 'react';

const { Panel } = Collapse;

const text = `
  A dog is a type of domesticated animal.
  Known for its loyalty and faithfulness,
  it can be found as a welcome guest in many households across the world.
`;

const Colapsable: React.FC = () => {
  const onChange = (key: string | string[]) => {
    console.log(key);
  };

  return (
    <Collapse onChange={onChange} style={{backgroundColor: 'white'}}>
      <Panel header="This is panel header 1" key="1" style={{marginTop: 20, backgroundColor: 'pink'}}>
        <p>{text}</p>
      </Panel>
      <Panel header="This is panel header 2" key="2" style={{marginTop: 20}}>
        <p>{text}</p>
      </Panel>
      <Panel header="This is panel header 3" key="3">
        <p>{text}</p>
      </Panel>
    </Collapse>
  );
};

export default Colapsable;
